import React from "react";
import SearchBar from "./SearchBar";
import { NavLink } from "react-router-dom";

const Nav = ({ onSearch }) => {
  return (
    <div>
      <SearchBar onSearch={onSearch} > 
      <button className="aceptar">
        <NavLink to="/about">About</NavLink>
      </button>
      <button className="aceptar">
        <NavLink to="/home">Home</NavLink>
      </button>
      </SearchBar>
    </div>
  );
};

export default Nav;
